import React from "react";
// import "../styles/Card.css"


function Navbar() {
  return (
    <div class="nav-bar">
      <a href="#about">About</a>
      <a href="#portfolio">Portfolio</a>
      <a href="#contact">Contact</a>
    </div>
  );
}

export default Navbar;
